import React from 'react';
import { FaLink } from 'react-icons/fa';
import './project_styles.css';

const Projects = () => {
  const projects = [
    { id: 1, title: 'Project 1', description: 'Description for Project 1', link: 'https://github.com/Shivanirudh' },
    { id: 2, title: 'Project 2', description: 'Description for Project 2', link: 'https://github.com/Shivanirudh'  },
    { id: 3, title: 'Project 3', description: 'Description for Project 3', link: 'https://github.com/Shivanirudh'  },
    { id: 4, title: 'Project 4', description: 'Description for Project 4', link: 'https://github.com/Shivanirudh'  },
    { id: 5, title: 'Project 5', description: 'Description for Project 5', link: 'https://github.com/Shivanirudh'  },
    // Add more projects as needed
  ];
  return (
    <div className="page">
     <div className="projects-content">
        <h2>My Projects</h2>
        <div className="projects-grid">
          {projects.map((project) => (
            <div key={project.id} className="project-item">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a href={project.link}><FaLink/>Link to github repo</a>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Projects;
